Ce réseau se veut inclusif et ouvert à tous. Le confort et la sécurité de notre communauté est notre priorité, et vous êtes prié de respecter et faire attention aux autres membres du réseau.
Cela implique d'être poli et courtois à chaque instant. Dans ce cadre, aucun comportement ou propos raciste, sexiste, homophobe, transphobe, xénophobe, etc, ne sera toléré.
Nous nous réservons le droit de les sanctionner de la manière qui nous semblera la plus adaptée.
Pour ces raisons, n'hésite pas à contacter l'administration si vous vous sentez attaqué par les propos ou le comportement d'un autre membre, ou si vous êtes témoin d'une telle situation.",1,1, NOW() - INTERVAL 1000 SECOND, NULL), ("Comme certains le savent déjà, ce réseau social a été créé il y a peu. Il y a en conséquence des règles à respecter, pour ne pas qu'il y ai de débordements.
Je m'occuperai de faire du tri sur le serveur !
Les règles seront modifiées, et le salon de règle affichera les contraintes du serveur.
Cela a uniquement pour but de conserver un esprit d'entraide et de convivialité", 2, 1, NOW() - INTERVAL 1000 SECOND, NULL), ("Bon , je vous annonce d'ors et déjà que Madeline me rejoint dans l'administration! Pour la seconde personne, je verrai ça en fin de semaine probablement ", 2, 1, NOW() - INTERVAL 1000 SECOND, NULL), ("Bonjour à tous ! Je rappelle à tous que les règles du serveur ne sont pas facultatives, qu'il faut les lire et les respecter avant tout (je ne m'amuse pas à les écrire juste pour passer le temps). Il y a plus de 20 membres qui ne s'y plient pas.", 2, 1, NOW() - INTERVAL 1000 SECOND, NULL), ("Deuxième annonce aujourd'hui, un peu plus légère celle ci, j'ai le plaisir de vous annoncer que Jeremy nous rejoint à l'administration du serveur :3", 2, 1, NOW() - INTERVAL 1000 SECOND, NULL), ("Le réseau a été créé pour, comme vous le savez, communiquer de facon plus informel.
Pour que le réseau reste propre et que tout se passe pour le mieux, vous devrez respecter quelques règles que je vous liste ci-dessous. Tout manquement à celles-ci sera sanctionné, gardons en tête le crédo du serveur : bienveillance.

